import React from 'react'
import logo from '../../assets/LogoCobras.JPG'
import './Store.css'

const Store = () => {
  return (
    <main className='store site-inner' aria-labelledby='store-title'>
        <h1 id='store-title'>Store currently under construction</h1>
        <p>Please try again later.</p>
        <img src={logo} alt='Seriana Cobras team logo' width='420' height='280' loading='lazy' />
    </main>
  )
}

export default Store
